INSERT INTO `tblattendees` (`AtID`, `AtCollectionID`, `AtIsActive`, `AtEmailAddress`, `AtHashTag`, `AtFirstName`, `AtLastName`, `AtText`, `AtImage`, `AtRow`, `AtColumn`, `AtAlignment`, `AtIsPublished`, `AtIsPinned`, `AtIPAddress`, `AtHeader`, `AtDateCreated`, `AtDateModified`, `AtCreatedBy`, `AtModifiedBy`) VALUES
	(1, 1, 1, '', '', 'President Halimah ', 'Yacob, SMU Patron', 'Congratulations and well done to SMU on achieving this remarkable milestone. Wishing SMU many more years of continued success!', '', 0, 0, '', 1, 1, '202.161.55.11', NULL, '2020-01-10 07:38:09', '2020-07-14 15:38:34', NULL, 1),
	(2, 2, 1, '', '', 'Dr Tony Tan,', ' SMU Honorary Patron', 'Congratulations to SMU on its twentieth anniversary. I wish the University continued progress and success in the years ahead.', '', 0, 0, '', 1, 1, '138.75.101.35', NULL, '2020-01-11 17:28:02', '2020-05-14 21:28:17', 0, 1),
	(3, 3, 1, '', '', 'Mr Lim', 'Chee Onn, SMU Chancellor', 'Congratulations to SMU on its 20th anniversary. Do press on with this fervour to achieve a position of even greater eminence over the next 2 decades.', '', 0, 0, '', 1, 1, '202.161.55.11', NULL, '2020-01-12 07:38:13', '2020-07-13 16:32:37', NULL, 2),
	(4, 4, 1, '', '', 'Mr Eddie', 'Teo, SMU Pro-Chancellor', 'May SMU continue to nurture, train and produce the most innovative, enterprising and entrepreneurial graduates and post-graduates in Singapore.', '', 0, 0, '', 1, 1, '202.161.55.11', NULL, '2020-01-15 07:38:14', '2020-07-13 16:32:38', NULL, 2),
	(5, 5, 1, '', '', 'Mr Ho', 'Kwon Ping, SMU Chairman', 'I\'m overwhelmed and humbled by SMU\'s success. But the future is even more challenging & we need humility, integrity & creativity to fulfil our vision.', '', 0, 0, '', 1, 1, '202.161.55.10', NULL, '2020-01-15 07:38:15', '2020-07-13 16:32:39', NULL, 2),
	(6, 6, 1, '', '', 'Prof Lily', 'Kong, SMU President', 'As you enter adulthood, may you always keep the energy and aspirations of youth, have the wisdom borne of experience and courage to forge the future.', '', 0, 0, '', 1, 1, '202.161.55.10', NULL, '2020-01-15 07:38:17', '2020-07-13 16:32:42', NULL, 2),
	(7, 7, 1, '', '', 'Prof Timothy ', 'Clark, SMU Provost', 'Becoming older doesn\'t mean you have to feel older. I hope the pioneering spirit, passion for innovation and youthful zest never leaves SMU.', '', 0, 0, '', 1, 1, '202.161.55.11', NULL, '2020-01-15 07:38:20', '2020-07-13 16:32:44', NULL, 2),
	(8, 8, 1, '', '', 'Lucas', 'Ng', 'Cheers to the past 20 years, and cheers to the next 20!', '', 0, 0, '', 1, 0, '202.161.55.11', '{\n    "Host": "smuwishandgift.ansuz.info",\n    "Connection": "keep-alive",\n    "Content-Length": "99",\n    "Accept": "*/*",\n    "Origin": "https://smuwishandgift.ansuz.info",\n    "X-Requested-With": "XMLHttpRequest",\n    "User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/79.0.3945.117 Safari/537.36",\n    "Content-Type": "application/x-www-form-urlencoded; charset=UTF-8",\n    "Sec-Fetch-Site": "same-origin",\n    "Sec-Fetch-Mode": "cors",\n    "Referer": "https://smuwishandgift.ansuz.info/",\n    "Accept-Encoding": "gzip, deflate, br",\n    "Accept-Language": "en-US,en;q=0.9",\n    "Cookie": "ci_session=4d6uan34oh0kpg9j82732a94s0u4qnr4"\n}', '2020-01-17 15:55:43', '2020-07-14 15:38:30', 1, 1),
